&quot;Villains&quot;, the season's first volume, began with the assassination attempt on Nathan
Petrelli [Adrian Pasdar] by Peter Petrelli [Milo Ventimiglia] from the future, and
explores its consequences. In addition, several villains with abilities escape from
the Company's prisons. Some of them join forces with Arthur Petrelli [Robert Forster]
[Peter's and Nathan's father] and Pinehearst Company, who are trying to create a formula
to give ordinary people abilities. Character arcs involve Tracy Strauss [Ali Larter]
discovering her origins, Sylar [Zachary Quinto] trying to decide his loyalties, Peter
losing his ability, Mohinder Suresh [Sendhil Ramamurthy] giving himself an ability, and
Hiro Nakamura's [Masi Oka] discovery of a family secret.

The second part of season three, titled &quot;Fugitives&quot;, involves what happens after Nathan
